(47052, NULL, 'Rick''s Mojito recipe ', '', 3, '2007-09-22 15:56:09', 'Lightly muddle two or three mint leaves at the bottom of a high ball glass. Add Rum and Sugar and stir well. Fill glass with ice. Top with club soda. Push a spoon down to lightly mix the soda and the rum mixture (don''t stir too much). Don''t drink more than two in a row!', 1, 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL, 0);
