(47053, NULL, 'Rick''s Hot Pesto', '', 3, '2007-09-24 13:19:05', '1. Grind up the garlic and basil in a food processor. <br>2. Add the cheese and olive oil and grind until smooth. <br><br>NOTE: This makes really hot pesto. Put a spoonful on spaghetti. Don''t use too much or it burns.', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0);
