(47059, NULL, 'Jane Brody''s Greek Chicken with Cheese', '', 3, '2007-09-26 21:03:05', '1. Slice the feta, place the feta in a bowl with cold water<br>2. Brown chicken in 1 tb olive oil<br>3. Remove chicken to plate, cook onions about 10 minutes, add garlic, cook a few more minutes until everything is soft and starting to brown.<br>4. Chop up the tomatoes in the can, dump the whole thing, juice and all into the pan. Stir it up, then heat until it starts to boil.<br>5. Put chicken back and tuck into the sauce. Grind some pepper over the whole thing.<br>6. Cover and simmer for 30 minutes.<br>7. Cover chicken with feta slices, cover and simmer 15 more minutes, until cheese is melted.', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0);
