(47091, NULL, 'Chinese Cabbage and Fish Stir Fry', '', 3, '2007-10-03 16:36:05', '1. Chop up the cabbage into big bites<br>2. Cut the fish into strips<br>3. Chop the garlic into big pieces. Don''t chop up the small cloves at all.<br>4. Heat sesame oil on medium heat in a pan or wok. Cook the garlic until it starts to get soft, a couple of minutes.<br>5. Add the cabbage and fish and cook a few minutes until the fish looks about done<br>6. Add the sake and simmer until everything is soft and cooked together.', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0);
