(47095, NULL, 'Martha Stewarts Chocolate Chip Cookies', '', 3, '2007-10-05 12:12:22', 'Discovered on the Amateur Gourmet Blog.<br><br>This recipe is available at:<br>http://www.amateurgourmet.com/2006/10/the_best_cookie.html. They also have some neat pictures about how best to bake them.<br><br>This was all copied from the Amateur Gourmet url listed above:<br><br>Preheat the oven to 375F, with racks in the upper and lower thirds. Line two large baking sheets with parchment paper; set aside. In a medium bowl, whisk together the flour, baking soda, and salt; set aside. In the bowl of an electric mixer fitted with the paddle attachment, beat the butter and both sugars on medium speed until light and fluffy, about 3 minutes, scraping down the sides of the bowl as needed.<br><br>Add the vanilla, whole egg, and egg white. Beat on low speed until well combined, scraping down the sides of the bowl as needed, about 1 minute. Add flour mixture in two batches; mix until just combined. Mix in chocolate.<br><br>Shape 2 heaping tablespoons of dough at a time into balls and place about 1 1/2 inches apart on prepared baking sheets. Bake, rotating sheets halfway through, until cookies are golden brown, about 18 minutes. Transfer parchment and cookies to a wire rack to cool completely. Cookies can be kept in an airtight container at room temperature for up to 4 days.', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0);
INSERT INTO `foods` (`id`, `calories`, `description`, `short_description`, `user_id`, `created_at`, `instructions`, `recipe`, `fat_grams`, `prot_grams`, `carbs_grams`, `alco_grams`, `sat_grams`, `trans_grams`, `chol_mgrams`, `sod_mgrams`, `fiber_grams`, `sugar_grams`, `fluid`) VALUES
