(47098, NULL, 'French Toast with homemade bread', '', 3, '2007-10-06 15:03:28', '1. Beat eggs, milk and vanilla together in wide bowl<br>2. Heat up a pan on medium heat<br>3. Add a little bit of butter to the pan and spread evenly<br>4. Dip three of the bread slices into the egg mixture. Don''t soak the bread, just give a nice thick and even coat<br>5. Cook the toast on each side until nicely browned, move to a warm oven to hold until the other pieces are cooked<br>6. Continue from step 3 until all done<br>', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0);
