(47283, NULL, 'Lime and Bourbon Toddy', '', 3, '2007-10-26 19:35:44', 'This recipe needs Bourbon. Dry whiskey like scotch won''t taste right. This is very good for colds, and not much else.<br><br>1. Put juice and bourbon in the bottom of a heat proof glass.<br>2. Add honey. If it''s stuck to the spoon, no problem, just leave it in until the next step.<br>3. Add 2 oz. (or more if desired) of boiling water. <br>4. Stir until the honey is dissolved.<br><br>Drink while still piping hot.', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0);
